import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import API from "../api";

export default function Register() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("student");
  const navigate = useNavigate();

  const submit = async () => {
    try {
      const res = await API.post("/auth/register", {
        name,
        email,
        password,
        role,
      });

      // Backend se token + role mil raha hai → direct login ho gaya!
      localStorage.setItem("token", res.data.token);
      localStorage.setItem("role", res.data.role);

      alert("Registered & Logged in Successfully!");

      // Seedha dashboard pe bhejo — LOGIN PAGE KABHI NAHI DIKHEGA!
      if (res.data.role === "admin") {
        navigate("/admin");
      } else {
        navigate("/student");
      }
    } catch (err) {
      console.log("Registration Error:", err.response?.data);
      alert(err.response?.data?.error || "Registration Failed");
    }
  };

  return (
    <div className="auth-container">
      <div className="auth-box">
        <h2 style={{ color: "white" }}>Register</h2>

        <input
          className="auth-input"
          type="text"
          placeholder="Full Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <input
          className="auth-input"
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <input
          className="auth-input"
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />

        <select
          className="auth-input"
          value={role}
          onChange={(e) => setRole(e.target.value)}
          style={{ padding: "12px", borderRadius: 6 }}
        >
          <option value="student">Student</option>
          <option value="admin">Admin</option>
        </select>

        <button className="auth-btn" onClick={submit}>
          Register
        </button>

        <p
          onClick={() => navigate("/login")}
          style={{ color: "white", marginTop: "20px", cursor: "pointer" }}
        >
          Already have an account? Login
        </p>
      </div>
    </div>
  );
}
